import React, { Component } from 'react';
import '../user/parameters.css'
import avatar from '../../images/avatar.jpg'

export class Parameters extends Component {
    render(){
        return (
        <div>
            <div className="card">
                <div>                   
                    <img alt="concours au cameroun online-school" src={avatar} className='avatar'></img>                   
                </div>  
                <div className="name">                   
                   <h3>Pseudo pseudo</h3>                   
                </div> 
                <div className="about">                   
                   <h3>à propos de moi</h3> 
                    <p>Nom :</p>
                    <p>Prénom :</p>
                    <p>Bibliographie : lkdsjksl dsdslkjd ksjdksjdksj ksdkdsjksjdks skjdksjd kskdjks</p>
                </div>                      
            </div>
        </div>
        );
    }
}
